import { useState, useEffect } from 'react';
import { supabase } from '../supabaseClient';

function Proximamente() {
  const [convocatorias, setConvocatorias] = useState([]);

  useEffect(() => {
    async function fetchConvocatorias() {
      // Consultar la tabla 'convocatorias' y limitar a las 3 primeras
      let { data, error } = await supabase
        .from('convocatorias')
        .select('id, dia') // Asegúrate de seleccionar los campos correctos
        .limit(3);

      if (error) {
        console.log('Error:', error.message);
      } else {
        setConvocatorias(data);
      }
    }

    fetchConvocatorias();
  }, []);

  return (
    <div>
      <h2>Próximas Convocatorias</h2>
      <ul>
        {convocatorias.map((convocatoria) => (
          <li key={convocatoria.id}>Convocatoria el {convocatoria.dia}</li>
        ))}
      </ul>
    </div>
  );
}

export default Proximamente;
